import React from 'react';
import Slider from '@material-ui/core/Slider';
import tripListData from './TripListData';

// sport: 0,
// monuments: 3,
// party: 3,
// hotels: 5,
// restaurants: 5,


export default function SiteSlider ({tripListData}) {

  const [value, setValue] = React.useState(5);

  return (
    <>
      Sport: <Slider disabled defaultValue={tripListData.slider.sport} aria-labelledby="continuous-slider" />
      Monuments: <Slider disabled defaultValue={tripListData.slider.monuments} aria-labelledby="continuous-slider" />

    </>
  );
}
